contract  Ownable {
    
address public  owner;


event LogOwnershipTransfered(address indexed  _currentowner , address indexed  _newowner);


modifier onlyOwner(){
    require(msg.sender == owner);
    _;
}

constructor() {
    owner =msg.sender;
}

}

